import React from 'react'
import { Navigate, Outlet } from 'react-router-dom'
const PublicRoutes = () => {
    let token = localStorage.getItem('access_token') || false
  return (
    !token ? <Outlet/> : <Navigate to='/admin'/>
  )
}

export default PublicRoutes
